CREATE OR REPLACE VIEW Leki_view AS
SELECT leki.nr_leku, leki.nazwa_leku, leki.opis, leki.producent_nr, leki_z_apteki.cena, leki_z_apteki.odnosnik, leki_z_apteki.zdjecie FROM LEKI
INNER JOIN leki_z_apteki ON leki.nr_leku = leki_z_apteki.lek_nr;

CREATE OR REPLACE TRIGGER Leki_Trigger
INSTEAD OF INSERT OR DELETE ON Leki_view
FOR EACH ROW
BEGIN
CASE
WHEN INSERTING THEN
WHEN DELETING THEN
DELETE FROM leki_z_apteki WHERE Lek_Nr = :OLD.Nr_Leku;
DELETE FROM Leki WHERE Nr_Leku = :OLD.Nr_Leku;
END CASE;
END;
/

